import React from "react";
import './Vote.css'
function Vote() {
  return (
    <div className="vote">
      <div className="withdrawal">
        <h1>WITHDRAWAL REQUEST : RECONSTRUCTION</h1>
      </div>
      <div className="your-vote">
        <h1>YOUR VOTE</h1>
      </div>
      <div className="vote-btns">
        <ul>
        <li><button>APPROVE</button></li>
        <li><button>REJECT</button></li>
        </ul>
      </div>
    </div>
  );
}
export default Vote;
